import React, { Component } from "react";

class RatingsFilterItems extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  onSelect = () => {
    this.setState({});
  };
  render() {
    const starRatingNum = [5, 4, 3, 2, 1];
    return (
      <ul>
        {starRatingNum.map(ratingNum => (
          <li key={ratingNum} style={{ listStyle: "none" }}>
            <div>
              <input type="checkbox" />
              {ratingNum}
            </div>
          </li>
        ))}
      </ul>
    );
  }
}

export default RatingsFilterItems;
